import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "./notes";


function App() {
    return <div>
        <Header />
        notes.map((key,title,content) => (<Note
            key={notes.key}
            title={notes.title}
            content={notes.content}
        />))
        <Footer /></div>
}

export default App;
